import "./reading.js";
import "./chart.js";

function Content() {
  return (
    <article className="bg-very-light-grey p3 flex-auto overflow-auto">
      <h1 className="regular darkgray line-height-1 mb3">Energy consumption</h1>
      <section className="mb3">
        <button
          className="
              h5
              inline-block
              shadow-2
              pl2
              pr2
              pt1
              pb1
              roundedMore
              border-grey
              bg-blue
              white
              bold
            "
        >
          Last 30 days
        </button>
      </section>
      <section className="chartHeight mb3">
        <canvas id="usageChart"></canvas>
      </section>
    </article>
  );

  function Person(name, age) {
    // Please supplement the code here
    var name, age;
    this.name = name;
    this.age = age;

    var Person1 = new Person("Tester", 10);
    console.log(Person1.name);
  }
}

export default Content;
